; /* Start:"a:4:{s:4:"full";s:56:"/local/templates/MAIN_NEW/js/countdown.js?14550071773585";s:6:"source";s:41:"/local/templates/MAIN_NEW/js/countdown.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
/**
 * @name		jQuery Countdown Plugin
 * @author		Martin Angelov
 * @version 	1.0
 * @url			http://tutorialzine.com/2011/12/countdown-jquery/
 * @license		MIT License
 */

(function($){
	
	//      
	var days	= 24*60*60,
		hours	= 60*60,
		minutes	= 60;
	
	//  
	$.fn.countdown = function(prop){
		
		var options = $.extend({
			callback	: function(){},
			timestamp	: 0
		},prop);
		
		var left, d, h, m, s, positions;

		//  
		init(this, options);
		
		positions = this.find('.position');
		
		(function tick(){
			
			//  
			left = Math.floor((options.timestamp - (new Date())) / 1000);
			
			if(left < 0){
				left = 0;
			}
			
			//  
			d = Math.floor(left / days);
			updateDuo(0, 1, d);
			left -= d*days;
			
			//  
			h = Math.floor(left / hours);
			updateDuo(2, 3, h);
			left -= h*hours;
			
			//  
			m = Math.floor(left / minutes);
			updateDuo(4, 5, m);
			left -= m*minutes;
			
			//  
			s = left;
			updateDuo(6, 7, s);
			
			//    
			options.callback(d, h, m, s);
			
			//       1 
			setTimeout(tick, 1000);
		})();
		
		//         
		function updateDuo(minor,major,value){
			switchDigit(positions.eq(minor),Math.floor(value/10)%10);
			switchDigit(positions.eq(major),value%10);
		}
		
		return this;
	};


	function init(elem, options){
		elem.addClass('countdownHolder');

		$.each(['Days','Hours','Minutes'],function(i){
			console.log(this);
			if ((this) == 'Days')
				var title = ':';
			if ((this) == 'Hours') 
				var title = ':';
			if ((this) == 'Minutes') 
				var title = ':';
			$('<div class="count'+this+'">').html(
				'<div class="title">'+title+'</div>\
				<span class="position">\
					<span class="digit static">0</span>\
				</span>\
				<span class="position">\
					<span class="digit static">0</span>\
				</span>'
			).appendTo(elem);
			
			// if(this!="Minutes"){
			// 	elem.append('<span class="countDiv countDiv'+i+'"></span>');
			// }
		});

	}

	//      
	function switchDigit(position,number){
		
		var digit = position.find('.digit')
		
		if(digit.is(':animated')){
			return false;
		}
		
		if(position.data('digit') == number){
			//     
			return false;
		}
		
		position.data('digit', number);
		
		var replacement = $('<span>',{
			'class':'digit',
			css:{
				top:'-2.1em',
				opacity:0
			},
			html:number
		});
		
		//  .static ,   .
		//    .
		
		digit
			.before(replacement)
			.removeClass('static')
			.animate({top:'2.5em',opacity:0},'fast',function(){
				digit.remove();
			})

		replacement
			.delay(100)
			.animate({top:0,opacity:1},'fast',function(){
				replacement.addClass('static');
			});
	}
})(jQuery);
/* End */
;
