; /* Start:"a:4:{s:4:"full";s:92:"/local/templates/MAIN_NEW/components/bitrix/menu/mobile-top-catalog/script.js?14550071773152";s:6:"source";s:77:"/local/templates/MAIN_NEW/components/bitrix/menu/mobile-top-catalog/script.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
$(document).ready(function() {
    if((window.location.href.indexOf('/catalog/') == -1 &&
        window.location.href.indexOf('/goods/') == -1 &&
        window.location.href.indexOf('/vacancies/') == -1 &&
        window.location.href.indexOf('/contacts/') == -1 &&
        window.location.href.indexOf('/buy/') == -1 &&
        window.location.href.indexOf('/sale/') == -1 &&
        window.location.href.indexOf('/details/') == -1) ||
        window.location.pathname == '/goods/') {
        if($('#catalog-left').length){
            var YPLMenu = $('#catalog-left').offset().top - 20;
            var BLSidebar = YPLSidebar + HLSidebar - HLMenu - 20;
        }
        if($('#catalog-left').length){
            YPLSidebar = $('#left-sidebar').offset().top;
        }
        
        var HLMenu = $('#catalog-left').height(),
            HLSidebar = $('#content').height(),
            HAdPanel = 0,
            timeFlag = true;

        if($('#panel').length)
            HAdPanel = $('#panel').height();

        $(window).scroll(function() {
            if( typeof( window.pageYOffset ) == 'number' ) {
                scrOfY = window.pageYOffset;
            }else{
                scrOfY = document.documentElement.scrollTop;
            }

            if(timeFlag) {
                HLSidebar = $('#content').height();
                BLSidebar = YPLSidebar + HLSidebar - HLMenu - 20;
            }

            if(scrOfY <= YPLMenu && $('#catalog-left').hasClass('fixed')) {
                $('#left-sidebar').css('padding-top', '0px');
                $('#catalog-left').removeClass('fixed');
            } else if((scrOfY > YPLMenu && scrOfY <= BLSidebar) && !$('#catalog-left').hasClass('fixed')) {
                $('#catalog-left').removeClass('absolute').removeAttr('style');
                $('#catalog-left').addClass('fixed');
                $('#left-sidebar').css('padding-top', HLMenu + 'px');
            } else if(scrOfY > BLSidebar && $('#catalog-left').hasClass('fixed')) {
                $('#catalog-left').removeClass('fixed');
                $('#catalog-left').addClass('absolute').css('top', (BLSidebar + 20 - HAdPanel) + 'px');
            }
        });

        setTimeout(
            function() {
                timeFlag = false;
            },
            20000
        )

        $('#catalog-left > ul > li').each(function(index) {
            if(index >= ($('#catalog-left > ul > li').length - 5)) {
                $(this).addClass('sub-bottom');
            }
        });
    }

    if($('#catalog-left .nav-button').length) {
        $('#catalog-left .nav-button').click(function(event) {
            if($(this).next('ul').hasClass('none')) {
                $(this).next('ul').removeClass('none');
				$(this).children('a').css('background-image', 'url(/images/temp-new/but-arrow-up.png)');
            } else {
                $(this).next('ul').addClass('none');
				$(this).children('a').css('background-image', 'url(/images/temp-new/but-arrow.png)');
            }

            event.preventDefault();
        });
    }
});
/* End */
;
